import React from "react";

function Note(props){
    return (
        <div className="note">
            <h1>{props.title}</h1>
            <p>{props.content}</p>
        </div>
    );
}

function NoteInput(){
    return (
        <div className="note noteInput">
            <input type="text" value="" placeholder="Title"></input>
            <input type="text" value="" placeholder="Take a note..."></input>
        </div>
    );
}

export default Note;
export {NoteInput};
